Up for sale is a barely used Remington 700 custom made and cambered in .308/7.62 NATO. This rifle was made by Remington  with 5R rifling in a 1/10 twist rate. It has a VTR style barrel with a muzzle brake milled into the end of the barrel. It has a custom made  Bell & Carlson Tactical Medalist Style 5 Fully Adjustable with 4.5oz mercury in the forend of the stock to help manage recoil. The barrel is free floating and has a  3-way adjustable butt assembly that adjusts for: ◦length of pull; 
◦cant (left/right butt tilt);
◦height (up/down); 

•adjustable cheekpiece for precise cheek/eye placement to scope; 
•Wide & Flat forend for bench / bag stability; 
•Anschutz-style forend rail (attaches accessories such as bipods, grips, etc.) 
 It will also come with an Custom Timney trigger that is set at a crisp 1.5lbs.  The bolt has been modified with a custom bolt shroud that allows for faster locking and unlocking of the bolt, along with a titanium firing pin and heavy firing spring. The scope that is on this rifle is a Leupold Mark 4 LRT 3.5 x 10 x 40 with mil dot reticale. This scope is mounted with Leupold mark 4 rings and one piece scope base (all torqued to leupold specs). The rifle will come in a fitted Pelican case. The rifle has had exactly 120 rnds down the barrel and those rnds were Sierra Match kings HPBT 175gr. I broke the barrel in according to the spec per Remington. once it was done being fired it was cleaned properly and then stored in the case which has dry sacks to keep out moisture. It will hold 1/4 groups at 100m all day long. I have over $2700 invested in this weapon. If you want more pics or info please call or text 337four2four6655. Im wanting serious buyers ONLY and NO low ballers. Im asking $1800 OBO and the only trade im looking for would be some sort of AR10 in 308 (Ruger SR762 preffered). Please know that this is a very well taken care of rifle and is worth every penny. Thanks for looking
